css:
body {
  font-size: 12px;
  color: #33ff97;
  background-color: #000000;
}
atom-pane {
  border-right: 1px solid #141414;
}
atom-pane:last-child {
  border-right: none;
}
.btn {
  color: #52ffa7;
  background-color: #0f0f0f;
}
.btn:hover,
.btn:focus {
  color: #3385ff;
  background-color: #1f1f1f;
}
.btn:active {
  color: rgba(255, 255, 255, 0.66);
  background-color: #0a0a0a;
}
.btn.selected {
  color: white;
  background-color: #1f1f1f;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.btn-primary {
  color: white;
  background-color: #0088ff;
}
.btn.btn-primary:hover,
.btn.btn-primary:focus {
  background-color: #1492ff;
}
.btn.btn-primary:active {
  background-color: #007deb;
}
.btn.btn-primary.selected {
  background-color: #1492ff;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #299bff;
}
.btn.btn-info {
  color: white;
  background-color: #0088ff;
}
.btn.btn-info:hover,
.btn.btn-info:focus {
  background-color: #1492ff;
}
.btn.btn-info:active {
  background-color: #007deb;
}
.btn.btn-info.selected {
  background-color: #1492ff;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #299bff;
}
.btn.btn-success {
  color: white;
  background-color: #1c9c71;
}
.btn.btn-success:hover,
.btn.btn-success:focus {
  background-color: #1fad7e;
}
.btn.btn-success:active {
  background-color: #188b65;
}
.btn.btn-success.selected {
  background-color: #1fad7e;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #22bf8a;
}
.btn.btn-warning {
  color: white;
  background-color: #cc8533;
}
.btn.btn-warning:hover,
.btn.btn-warning:focus {
  background-color: #d08e43;
}
.btn.btn-warning:active {
  background-color: #bc7a2f;
}
.btn.btn-warning.selected {
  background-color: #d08e43;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #d49854;
}
.btn.btn-error {
  color: white;
  background-color: #d92626;
}
.btn.btn-error:hover,
.btn.btn-error:focus {
  background-color: #dc3838;
}
.btn.btn-error:active {
  background-color: #c72323;
}
.btn.btn-error.selected {
  background-color: #dc3838;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #df4949;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor[mini] {
  padding-left: 5px;
  color: #33ff97;
  border-radius: 2px;
  background-color: #000000;
}
atom-text-editor[mini].is-focused {
  background-color: #000000;
}
atom-text-editor[mini] .placeholder-text {
  color: #e6e6e6;
}
atom-text-editor[mini] .selection .region {
  background-color: red;
}
.find-and-replace {
  border-top: 1px solid #141414;
}
.status {
  color: #33ff97;
}
.status-added {
  color: #66ffb1;
}
.status-ignored {
  color: #e6e6e6;
}
.status-modified {
  color: #66a3ff;
}
.status-removed {
  color: #ff6666;
}
.status-renamed {
  color: gray;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 2px;
  background-color: #000000;
}
.list-group li {
  padding-left: 5px;
}
.list-group li.selected {
  color: white;
  background-color: red;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: white;
}
.select-list li {
  padding: 5px 10px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 5px;
  border-radius: 2px;
  background-color: #121212;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
.panel-heading {
  border-bottom: 1px solid #141414;
  background-color: #0f0f0f;
}
.inset-panel {
  background-color: #0f0f0f;
}
.inset-panel .panel-heading {
  background-color: #1a1a1a;
}
atom-panel.modal {
  border: 1px solid #141414;
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.ui-site-1 {
  background-color: #0088ff;
}
.ui-site-2 {
  background-color: #20b684;
}
.ui-site-3 {
  background-color: #cc8533;
}
.ui-site-4 {
  background-color: #D831B0;
}
.ui-site-5 {
  background-color: #EBDD5B;
}
.status-bar {
  font-size: 12px;
  color: #33ff97;
  border-top: 1px solid #141414;
  background-color: #050505;
}
.tab-bar {
  background-color: #050505;
  border-bottom: 1px solid #141414;
}
.tab-bar .tab {
  color: #33ff97;
  height: 60px;
  line-height: 60px;
  font-size: 14px;
  border-right: 1px solid #141414;
  background-color: #050505;
}
.tab-bar .tab.active {
  color: white;
  background-color: red;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 14px;
  margin-top: -3px;
  border-color: gray;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon:hover {
  color: red;
}
.tab-bar .tab.active .close-icon:hover {
  color: #3385ff;
}
.tab-bar .tab.is-dragging {
  background: #000000;
  border-color: transparent;
  opacity: .5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #e6e6e6;
}
.text-highlight {
  color: #3385ff;
}
.text-info {
  color: gray;
}
.text-success {
  color: #66ffb1;
}
.text-warning {
  color: #66a3ff;
}
.text-error {
  color: #ff6666;
}
.highlight {
  padding: 1px 4px;
  color: #3385ff;
  border-radius: 2px;
  background-color: #121212;
}
.highlight-info {
  padding: 1px 4px;
  color: #3385ff;
  border-radius: 2px;
  background-color: #0088ff;
}
.highlight-warning {
  padding: 1px 4px;
  color: #3385ff;
  border-radius: 2px;
  background-color: #cc8533;
}
.highlight-error {
  padding: 1px 4px;
  color: #3385ff;
  border-radius: 2px;
  background-color: #d92626;
}
.highlight-success {
  padding: 1px 4px;
  color: #3385ff;
  border-radius: 2px;
  background-color: #1c9c71;
}
.background-message {
  font-weight: bold;
  color: #e6e6e6;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: .75em;
  white-space: nowrap;
  max-width: none;
}
.tooltip .keystroke {
  padding: .15em .4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: white;
  background: red;
}
.tree-view-resizer {
  border-right: px solid #141414;
}
.tree-view {
  color: #33ff97;
  background-color: #050505;
}
.tree-view .list-item.selected {
  color: white;
}
